import './style.scss';
import './_reset.scss';

class App extends React.Component {

  render() {
    return(
      <BrowserRouter>
        <Header />
        <Main />
        {/* <History /> */}
        <Footer />

      </BrowserRouter>
    )
  }
}

export default App;
